import React from 'react';
import Case from './Case';


class Raw extends React.Component{
  constructor(props) {
    super(props);
    var rows = [];
    for (var i = 0; i < 15; i++) {
      rows.push(<Case aorb={this.props.aorb}></Case>)
    }
  }


  render() {
    return (
      <div className={"raw"+this.props.aorb}>
        {rows}
      </div>
    );
  }
}


export default Raw;
